The next season, I stopped competing in the Dew Tour, which disqualified me for other events. My sponsors fired me, and I was left without income or direction. Because skiing was everything to me, it felt like I lost everything. I said that I would never give up, but I kind of gave up on myself after missing the Olympics. Drugs and alcohol became my way of staying alive. Although not making the Olympics was one part of it, I‚Äôve had a problem since I was 15. There were a lot of issues that I didn‚Äôt know how to deal with. Drugs and alcohol were like my way to escape. I didn‚Äôt know how to deal with all the pain. I was also undiagnosed bipolar, and many people with bipolar use drugs and alcohol to cope. Furthermore, 1 in 5 people with bipolar end up committing suicide, which I‚Äôve tried probably about 3 or 4 times. 

In addition to overdosing several times, I jumped off an 80-100 ft cliff. I landed on the beach and was knocked unconscious. I probably should have died, but I didn‚Äôt. While I was unconscious, I saw guardian angels who made me realize that I wasn‚Äôt ready to go. After waking up, I crawled about half a mile and called an ambulance. I was in intensive care for a week, which should have been much longer, but my symptoms cleared up pretty fast. However, the drugs didn‚Äôt stop. It got to the point where I started stealing. I had never stolen anything in my life, but drugs took me to that level. I was homeless, got robbed several times, and saw people dying. I had given up hope. I went from being at the top of the world to the bottom of the world.‚Äù";}i:17;a:1:{s:14:"comments_count";i:1;}i:18;a:1:{s:11:"likes_count";i:9;}i:19;a:1:{s:4:"link";s:39:"https://www.instagram.com/p/CEvDSmnB0zI";}i:20;a:1:{s:5:"image";s:238:"https://scontent-sin6-1.cdninstagram.com/v/t51.2885-15/e35/118730264_607332113486208_4727135821395206599_n.jpg?_nc_ht=scontent-sin6-1.cdninstagram.com&_nc_cat=100&_nc_ohc=QfThDHN1CGQAX8oiqW6&oh=8251ec6a584b4b279576bda6cd43310e&oe=5F7A98FE";}i:21;a:1:{s:4:"type";s:5:"image";}i:22;a:1:{s:8:"owner_id";i:39780440928;}i:23;a:1:{s:14:"owner_username";s:0:"";}i:24;a:1:{s:14:"owner_fullname";s:0:"";}i:25;a:1:{s:9:"owner_pic";s:0:"";}i:26;a:1:{s:2:"id";s:19:"2391139829909646974";}i:27;a:1:{s:10:"short_code";s:11:"CEvCQGqDW5-";}i:28;a:1:{s:12:"created_time";i:1599266379;}i:29;a:1:{s:7:"caption";s:424:"triple lutz and triple toe at the end of my longü•∞also sorry for another live barn vid oopsüôÉ

